interface CHATBOT {
    /**
     * 获取当前阿里云账号的业务空间列表。
     */
    ListAgent(query: ListAgentRequest): Promise<ListAgentResponse>;
    /**
     * 新建意图，主要包含意图的meta信息，如：意图名称、意图别名、意图关联词槽信息；不包含意图话术、LGF。
     */
    CreateIntent(query: CreateIntentRequest): Promise<CreateIntentResponse>;
    /**
     * 查询视角列表。
     */
    QueryPerspectives(query: QueryPerspectivesRequest): Promise<QueryPerspectivesResponse>;
    /**
     * 修改意图话术信息。
     */
    UpdateUserSay(query: UpdateUserSayRequest): Promise<UpdateUserSayResponse>;
    /**
     * 为指定意图创建高级语义配置（LGF）。
     */
    UpdateLgf(query: UpdateLgfRequest): Promise<UpdateLgfResponse>;
    /**
     * 删除知识的关联知识。
     */
    DeleteConnQuestion(query: DeleteConnQuestionRequest): Promise<DeleteConnQuestionResponse>;
    /**
     * 创建知识答案。
     */
    CreateSolution(query: CreateSolutionRequest): Promise<CreateSolutionResponse>;
    /**
     * 创建一条知识。
     */
    CreateFaq(query: CreateFaqRequest): Promise<CreateFaqResponse>;
    /**
     * 为知识添加关联知识。
     */
    CreateConnQuestion(query: CreateConnQuestionRequest): Promise<CreateConnQuestionResponse>;
    /**
     * 删除答案。
     */
    DeleteSolution(query: DeleteSolutionRequest): Promise<DeleteSolutionResponse>;
    /**
     * 查询知识的相似问题列表。
     */
    ListSimQuestion(query: ListSimQuestionRequest): Promise<ListSimQuestionResponse>;
    /**
     * 删除指定高级语义配置。
     */
    DeleteLgf(query: DeleteLgfRequest): Promise<DeleteLgfResponse>;
    /**
     * 删除一条知识。
     */
    DeleteFaq(query: DeleteFaqRequest): Promise<DeleteFaqResponse>;
    /**
     * 创建相似问题。
     */
    CreateSimQuestion(query: CreateSimQuestionRequest): Promise<CreateSimQuestionResponse>;
    /**
     * 更新相似问题。
     */
    UpdateSimQuestion(query: UpdateSimQuestionRequest): Promise<UpdateSimQuestionResponse>;
    /**
     * 取消正在发布中的任务。
     */
    CancelPublishTask(query: CancelPublishTaskRequest): Promise<CancelPublishTaskResponse>;
    /**
     * 查询指定机器人下的实体列表数据，仅返回每个实体的meta信息，如：实体类型、实体名称、创建时间、修改时间等。
     */
    ListDSEntity(query: ListDSEntityRequest): Promise<ListDSEntityResponse>;
    /**
     * 创建视角。
     */
    CreatePerspective(query: CreatePerspectiveRequest): Promise<CreatePerspectiveResponse>;
    /**
     * 查询知识的答案列表。
     */
    ListSolution(query: ListSolutionRequest): Promise<ListSolutionResponse>;
    /**
     * 更新答案。
     */
    UpdateSolution(query: UpdateSolutionRequest): Promise<UpdateSolutionResponse>;
    /**
     * 更新视角名称和描述。
     */
    UpdatePerspective(query: UpdatePerspectiveRequest): Promise<UpdatePerspectiveResponse>;
    /**
     * 在发布机器人的过程中，取消机器人发布任务。
     */
    CancelInstancePublishTask(query: CancelInstancePublishTaskRequest): Promise<CancelInstancePublishTaskResponse>;
    /**
     * 根据用户query联想知识库中的FAQ。
     */
    Associate(query: AssociateRequest): Promise<AssociateResponse>;
    /**
     * 修改意图，主要包含意图的meta信息，如：意图名称、意图别名、意图关联词槽信息；不包含意图话术、LGF。
     */
    UpdateIntent(query: UpdateIntentRequest): Promise<UpdateIntentResponse>;
    /**
     * 删除相似问题。
     */
    DeleteSimQuestion(query: DeleteSimQuestionRequest): Promise<DeleteSimQuestionResponse>;
    /**
     * 查询知识的关联问题列表。
     */
    ListConnQuestion(query: ListConnQuestionRequest): Promise<ListConnQuestionResponse>;
    /**
     * 查询发布进度。
     */
    GetPublishTaskState(query: GetPublishTaskStateRequest): Promise<GetPublishTaskStateResponse>;
    /**
     * 更新机器人名称，描述。
     */
    UpdateInstance(query: UpdateInstanceRequest): Promise<UpdateInstanceResponse>;
    /**
     * 搜索知识。
     */
    SearchFaq(query: SearchFaqRequest): Promise<SearchFaqResponse>;
    /**
     * 获取欢迎语接口。
     */
    BeginSession(query: BeginSessionRequest): Promise<BeginSessionResponse>;
    /**
     * 为指定的某个实体，添加实体成员信息，包含：实体值、对应的同义词列表，同一实体内部的实体值、同义词唯一。
     */
    CreateDSEntityValue(query: CreateDSEntityValueRequest): Promise<CreateDSEntityValueResponse>;
    /**
     * 删除类目， 已发布的类目变成已删除未发布状态，未发布的类目则直接删除。
     */
    DeleteCategory(query: DeleteCategoryRequest): Promise<DeleteCategoryResponse>;
    /**
     * 查询机器人列表。
     */
    ListInstance(query: ListInstanceRequest): Promise<ListInstanceResponse>;
    /**
     * 将沙箱机器人发布到线上。
     */
    CreateInstancePublishTask(query: CreateInstancePublishTaskRequest): Promise<CreateInstancePublishTaskResponse>;
    /**
     * 查询机器人详情。
     */
    DescribeInstance(query: DescribeInstanceRequest): Promise<DescribeInstanceResponse>;
    /**
     * 查询指定机器人下指定实体的meta信息，如：实体类型、实体名称、创建时间、修改时间等。
     */
    DescribeDSEntity(query: DescribeDSEntityRequest): Promise<DescribeDSEntityResponse>;
    /**
     * 删除视角。
     */
    DeletePerspective(query: DeletePerspectiveRequest): Promise<DeletePerspectiveResponse>;
    /**
     * 针对用户query，返回机器人有关这个query的语言理解（nlu）结果。当前只支持对话工厂、中控的NLU信息透出，其他引擎后续按需支持。
     */
    Nlu(query: NluRequest): Promise<NluResponse>;
    /**
     * 修改意图话术信息。
     */
    DeleteUserSay(query: DeleteUserSayRequest): Promise<DeleteUserSayResponse>;
    /**
     * 机器人发布告警时，忽略告警并继续发布。
     */
    ContinueInstancePublishTask(query: ContinueInstancePublishTaskRequest): Promise<ContinueInstancePublishTaskResponse>;
    /**
     * 查看单个类目信息。
     */
    DescribeCategory(query: DescribeCategoryRequest): Promise<DescribeCategoryResponse>;
    /**
     * 查询视角详情。
     */
    DescribePerspective(query: DescribePerspectiveRequest): Promise<DescribePerspectiveResponse>;
    /**
     * 返回指定意图的 meta 信息，如：意图类型、意图名称、创建时间、修改时间等。
     */
    DescribeIntent(query: DescribeIntentRequest): Promise<DescribeIntentResponse>;
    /**
     * 机器人绑定知识类目。
     */
    LinkInstanceCategory(query: LinkInstanceCategoryRequest): Promise<LinkInstanceCategoryResponse>;
    /**
     * 查询知识详情。
     */
    DescribeFaq(query: DescribeFaqRequest): Promise<DescribeFaqResponse>;
    /**
     * 新建类目。
     */
    CreateCategory(query: CreateCategoryRequest): Promise<CreateCategoryResponse>;
    /**
     * 创建实体，特指实体的Meta信息，如：实体名称、实体类型。
     */
    CreateDSEntity(query: CreateDSEntityRequest): Promise<CreateDSEntityResponse>;
    /**
     * 获取类目列表。
     */
    ListCategory(query: ListCategoryRequest): Promise<ListCategoryResponse>;
    /**
     * 查询指定机器人下的意图列表数据，仅返回每个意图的 meta 信息，如：意图类型、意图名称、创建时间、修改时间等。
     */
    ListIntent(query: ListIntentRequest): Promise<ListIntentResponse>;
    /**
     * 实体meta信息修改，仅支持修改实体名称；实体类型不支持修改。
     */
    UpdateDSEntity(query: UpdateDSEntityRequest): Promise<UpdateDSEntityResponse>;
    /**
     * 删除一个意图，会级联删除该意图下所有的意图话术和高级语义配置（LGF）。
     */
    DeleteIntent(query: DeleteIntentRequest): Promise<DeleteIntentResponse>;
    /**
     * 为指定意图创建高级语义配置（LGF）。
     */
    CreateLgf(query: CreateLgfRequest): Promise<CreateLgfResponse>;
    /**
     * 为指定意图添加话术信息。
     */
    CreateUserSay(query: CreateUserSayRequest): Promise<CreateUserSayResponse>;
    /**
     * 查询指定意图的高级语义配置（LGF）。
     */
    ListLgf(query: ListLgfRequest): Promise<ListLgfResponse>;
    /**
     * 根据机器人唯一标识（机器人ID）与其进行会话，仅适用于智能对话机器人（旧版）。
     */
    Chat(query: ChatRequest): Promise<ChatResponse>;
    /**
     * 修改某个实体的某个实体成员，有实体值&同义词、正则表达式两类数据修改。注意：往一个标准实体中添加正则表达式是不被允许的，反之亦然。
     */
    UpdateDSEntityValue(query: UpdateDSEntityValueRequest): Promise<UpdateDSEntityValueResponse>;
    /**
     * 更新关联关系。
     */
    UpdateConnQuestion(query: UpdateConnQuestionRequest): Promise<UpdateConnQuestionResponse>;
    /**
     * 查询指定意图的话术内容及关联槽位信息，支持关键话术筛选（contains）。
     */
    ListUserSay(query: ListUserSayRequest): Promise<ListUserSayResponse>;
    /**
     * 编辑类目。
     */
    UpdateCategory(query: UpdateCategoryRequest): Promise<UpdateCategoryResponse>;
    /**
     * 删除某个实体的某个成员；若为标准实体，会同步删除其同义词（若有）。
     */
    DeleteDSEntityValue(query: DeleteDSEntityValueRequest): Promise<DeleteDSEntityValueResponse>;
    /**
     * 查询指定实体的实体成员列表及详情数据，同时支持关键词筛选（contains），筛选范围：实体值、同义词。
     */
    ListDSEntityValue(query: ListDSEntityValueRequest): Promise<ListDSEntityValueResponse>;
    /**
     * 创建沙箱环境机器人。
     */
    CreateInstance(query: CreateInstanceRequest): Promise<CreateInstanceResponse>;
    /**
     * 删除沙箱和线上的机器人。
     */
    DeleteInstance(query: DeleteInstanceRequest): Promise<DeleteInstanceResponse>;
    /**
     * 编辑一条知识。
     */
    UpdateFaq(query: UpdateFaqRequest): Promise<UpdateFaqResponse>;
    /**
     * 查询机器人发布进度。
     */
    GetInstancePublishTaskState(query: GetInstancePublishTaskStateRequest): Promise<GetInstancePublishTaskStateResponse>;
    /**
     * 保存用户对于问答结果的评价。
     */
    Feedback(query: FeedbackRequest): Promise<FeedbackResponse>;
    /**
     * 删除一个实体，会级联删除该实体下所有的实体成员及同义词、正则表达式。
     */
    DeleteDSEntity(query: DeleteDSEntityRequest): Promise<DeleteDSEntityResponse>;
    /**
     * 创建发布中心的发布任务。
     */
    CreatePublishTask(query: CreatePublishTaskRequest): Promise<CreatePublishTaskResponse>;
    /**
     * 获取异步服务执行结果，配合Chat接口使用。
     */
    GetAsyncResult(query: GetAsyncResultRequest): Promise<GetAsyncResultResponse>;
    /**
     * 用于聊天窗用户免登时，获取Token。通过Token可将用户的企业身份带入机器人。同时支持访客名片的自定义信息的带入。
     */
    GenerateUserAccessToken(query: GenerateUserAccessTokenRequest): Promise<GenerateUserAccessTokenResponse>;
    /**
     * 通过渠道后台配置生成的from值，自定义初始化im连接信息，初始化时支持传递用户鉴权token。
     */
    InitIMConnect(query: InitIMConnectRequest): Promise<InitIMConnectResponse>;
    /**
     * 获取业务空间ID。
     */
    GetAgentInfo(query: GetAgentInfoRequest): Promise<GetAgentInfoResponse>;
    /**
     * 获取SaaS被集成信息列表。
     */
    ListSaasInfo(query: ListSaasInfoRequest): Promise<ListSaasInfoResponse>;
    /**
     * 获取权限被集成信息列表，可通过该列表返回的权限组，给用户授权。
     */
    ListSaasPermissionGroupInfos(query: ListSaasPermissionGroupInfosRequest): Promise<ListSaasPermissionGroupInfosResponse>;
    /**
     * 获取流式调用的连接信息。
     */
    ApplyForStreamAccessToken(query: ApplyForStreamAccessTokenRequest): Promise<ApplyForStreamAccessTokenResponse>;
    /**
     * 文档新建
     */
    CreateDoc(query: CreateDocRequest): Promise<CreateDocResponse>;
    /**
     * 删除文档
     */
    DeleteDoc(query: DeleteDocRequest): Promise<DeleteDocResponse>;
    /**
     * 文档重试
     */
    RetryDoc(query: RetryDocRequest): Promise<RetryDocResponse>;
    /**
     * 文档详情
     */
    DescribeDoc(query: DescribeDocRequest): Promise<DescribeDocResponse>;
    /**
     * 搜索文档
     */
    SearchDoc(query: SearchDocRequest): Promise<SearchDocResponse>;
    /**
     * 更新文档
     */
    UpdateDoc(query: UpdateDocRequest): Promise<UpdateDocResponse>;
    /**
     * 调用ListTongyiChatHistorys接口获取会话历史明细。
     */
    ListTongyiChatHistorys(query: ListTongyiChatHistorysRequest): Promise<ListTongyiChatHistorysResponse>;
    /**
     * 查询机器⼈问答概览指标
     */
    GetBotSessionData(query: GetBotSessionDataRequest): Promise<GetBotSessionDataResponse>;
}
export default CHATBOT;
